import {observe,config} from './utils';
import {useState} from 'react'
config.funReg = /^set/;
const countState = observe({
  count : 0,
  addCount(value){
    setTimeout(()=>  this.count += value,0)
    
  }
},{
  funReg : /^add/
})

function App() {
  const c = countState()
  const [isShowing,showing] = useState(true);
  return (
    <div className="App">
      {c.count}
      <AddBtn/>
     
      {isShowing? <Test/> : null}

    </div>
  );
}

const AddBtn = ()=>{
  const c = countState();
  return <button onClick={()=>c.addCount(1)}> add </button>
} 
const Test = ()=>{
  const c = countState();
  return <h1>{c.count}</h1>
}

export default App;
